import React from 'react';

import './sidebar.css';
import { Link, HashRouter as Router, Route, Switch } from 'react-router-dom';

const Sidebar = () => {
    return (
        
        <Router>
            <div>
                <Switch>
                    <Route path="/:category"/>
                </Switch>
            </div>
        </Router>
    );
}

export default Sidebar
